import './../Style/History.css';
import { useState, useEffect } from "react";
import {variables} from "../Variables";
import React from 'react';
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'

function AppHistory(){
    const [order, setOrder] = useState([]);

    useEffect(() => {
        fetch(variables.API_URL+"get_order_user/"+localStorage.getItem("id"), {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setOrder(result)
            }
        )
    }, []);

    async function handleOrderDetail(e, value){
        const MySwal = withReactContent(Swal);
        for (let index = 0; index < order.length; index++) {
            const element = order[index];
            if(element.order_id === value){
                MySwal.fire({
                    html: 
                    <>
                    <h2>Shop Name : {element.shop_name}</h2>
                    {element.order_detail.map((item) => {
                    <span>
                        <div className="PS_menu_box">
                            <div className="PS_menu_img"><img src="https://www.aloexhair.com/wp-content/uploads/2018/06/shutterstock_708886852.jpg" alt=""></img></div>
                            <div className="PS_menu_details">
                                <div className="PS_menu_name">{item.menu_name}</div>
                                <div className="PS_menu_price">ราคา {item.price} B</div>
                            </div>
                            <div className="PS_menu_icon">
                                {shop.create_by.toString() === localStorage.getItem('id').toString()?
                                    <Link to={"/EditMenuShop/"+item.menu_id}><i className="fa-solid fa-pen"></i></Link>:''}
                                <i className="fa-solid fa-circle-plus" onClick={(e)=>{handleCart(e, item.menu_id, 0)}}></i>
                            </div>
                        </div>
                    </span>
                    })}
                    </>,
                    confirmButtonColor: "#F07221"
                }).then(() => {
                    // window.location.reload(false);
                })
            }
        }
    }

    if(order.length > 0){
        const order_list = order.map((item, index) => (
            <tr key={index}>
              {/* <td>{item.order_id}</td> */}
              <td><button onClick={(e)=>{handleOrderDetail(e, item.order_id)}}> Click to See Detail </button></td>
              <td>{item.create_time.replace("T", " ").replace(".000Z", " ")}</td>
              <td>{item.status}</td>
              <td>-</td>
            </tr>
          ));

    return(
    <div className="history">
        <h1>User Service History</h1>
        <div className='history-table'>
            <table>
                <thead>
                    <tr>
                        <th>Deatils</th>
                        <th>Date Time</th>
                        <th>Status</th>
                        <th>To Review</th>
                    </tr>
                </thead>
                <tbody>
                    {order.length !== 0?order_list:''}
                </tbody>
            </table>
        </div>
    </div>
    );
    }
}

export default AppHistory;
